import React, { useState } from 'react';
import '../styles/SignupForm.css';


function SignupForm() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmpassword, setConfirmPassword] = useState('');
  const [name, setName] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };
  const handleConfirmPassword = (e) => {
    setConfirmPassword(e.target.value);
  };

  const handleNameChange = (e) => {
    setName(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // 회원가입 요청 처리
    // 이 부분에서 실제로 서버와 통신하여 회원가입 처리를 수행합니다.
    // 예시로는 간단히 콘솔에 회원가입 정보를 출력하는 예시를 보여줍니다.

    console.log('Email:', email);
    console.log('Password:', password);
    console.log('Name:', name);

    // 회원가입 후에 필요한 처리를 수행합니다.
    // 예를 들어, 회원가입 성공 시에 다른 페이지로 이동하거나 상태를 업데이트하는 등의 작업을 수행할 수 있습니다.
  };

  return (
    <div className='wrapper'>
      <div class="title"><h1 style="font-size: 21px;">회원가입</h1></div>
      <form onSubmit={handleSubmit}>
      <div className='flex flex-col w-60 items-start p-4'>
        <div className='mt-4'>
          <label className=''>Email:</label>
          <input type="email" className='w-full border-2' placeholder='특수문자 사용 불가, 최소 2자 이상'value={email} onChange={handleEmailChange} />
        </div>
        <div className='mt-10'>
          <label>비밀번호 :</label>
          <input type="password" className='w-full border-2' placeholder='숫자, 영어, 특수문자 혼합 8자 이상' value={password} onChange={handlePasswordChange} />
        </div>
        <div>
          <label>비밀번호 확인 :</label>
          <input type="password" className='w-full border-2'  value={confirmpassword} onChange={handleConfirmPassword} />
        </div>
        <div>
          <label>수영장 이름:</label>
          <input type="text" className='w-full border-2' value={name} onChange={handleNameChange} />
        </div>
        <div>
          <label>수영장 wjsghkqjsgh:</label>
          <input type="text" className='w-full border-2' value={name} onChange={handleNameChange} />
        </div>
        <div>
          <label>수영장 주소:</label>
          <input type="text" className='w-full border-2' value={name} onChange={handleNameChange} />
        </div>
        <button type="submit">회원 가입</button>
      </div>
    </form>
    </div>
    
  );
}

export default SignupForm;
